import logo from './logo.svg';

function App() {
  return (
    <div className="App">
      <header className="App-header">         
          Header Gil Pena Portfolio 
        <a className="btn btn-primary"
             data-bs-toggle="collapse"
             href="#collapseExample"
             role="button"
             aria-expanded="false"
             aria-controls="collapseExample">
        Bootstrap button
        </a>
    </header>
    <p> React body </p>
    </div>
  );
}

export default App;
